import React from 'react';
import { 
  Box, 
  Typography, 
  Grid, 
  Paper,
  Chip,
  Button,
  Card,
  CardContent,
  CardMedia
} from '@mui/material';
import { styled } from '@mui/material/styles';
import LocalOfferIcon from '@mui/icons-material/LocalOffer';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

const DiscountCard = styled(Paper)(({ theme }) => ({
  backgroundColor: '#fff',
  borderRadius: 18,
  overflow: 'hidden',
  transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  '&:hover': {
    transform: 'translateY(-4px)',
    boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
  },
}));

const ImagePlaceholder = styled(Box)(({ theme }) => ({
  width: '100%',
  height: 140,
  backgroundColor: '#f5f5f5',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  color: '#999',
}));

const ContentBox = styled(Box)(({ theme }) => ({
  padding: 20,
}));

const EventCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.2s ease-in-out',
  '&:hover': {
    transform: 'translateY(-4px)',
  },
}));

const DiscountChip = styled(Chip)(({ theme }) => ({
  backgroundColor: theme.palette.error.main,
  color: '#fff',
  position: 'absolute',
  top: 16,
  right: 16,
  fontWeight: 'bold',
}));

const BrandDiscounts = ({ preview = false }) => {
  const discounts = [
    {
      id: 1,
      brand: 'ZARA',
      title: '여름 시즌오프',
      discount: '최대 50%',
      description: '컬러풀한 여름 아이템 할인',
      remainingDays: 5,
      imageUrl: null,
    },
    {
      id: 2,
      brand: 'UNIQLO',
      title: '린넨 컬렉션',
      discount: '30%',
      description: '시원한 린넨 의류 특가',
      remainingDays: 3,
      imageUrl: null,
    },
    {
      id: 3,
      brand: 'H&M',
      title: '컬러 티셔츠 기획전',
      discount: '2+1',
      description: '베이직 티셔츠 구매 이벤트',
      remainingDays: 7,
      imageUrl: null,
    }
  ];

  const events = [
    {
      id: 1,
      title: '색각 이상자 전용 컬러 컨설팅',
      image: 'https://source.unsplash.com/random/400x200/?fashion,consulting',
      brand: 'Style Lab',
      discount: '30%',
      period: '2024.03.01 - 2024.03.31',
      description: '개인 맞춤형 컬러 컨설팅을 특별 할인된 가격으로 만나보세요.',
    },
    {
      id: 2,
      title: '컬러 라벨 의류 기획전',
      image: 'https://source.unsplash.com/random/400x200/?clothing,label',
      brand: 'Universal Fashion',
      discount: '20%',
      period: '2024.03.15 - 2024.04.15',
      description: '색상 구분이 쉬운 특별 제작 의류 라인을 할인된 가격에 제공합니다.',
    },
  ];

  const displayEvents = preview ? [events[0]] : events;

  return (
    <Box>
      <Typography variant="h3" gutterBottom sx={{ 
        fontSize: '1.8rem', 
        fontWeight: 600, 
        color: '#333',
        marginBottom: '25px',
        borderBottom: '1px solid #eee',
        paddingBottom: '15px',
        display: 'flex',
        alignItems: 'center',
        gap: 1
      }}>
        <LocalOfferIcon sx={{ fontSize: '1.8rem' }} />
        브랜드 할인/이벤트
      </Typography>
      
      <Grid container spacing={3}>
        {displayEvents.map((event) => (
          <Grid item xs={12} sm={6} md={4} key={event.id}>
            <EventCard>
              <Box sx={{ position: 'relative' }}>
                <CardMedia
                  component="img"
                  height={preview ? "140" : "200"}
                  image={event.image}
                  alt={event.title}
                />
                <DiscountChip
                  icon={<LocalOfferIcon />}
                  label={`SALE ${event.discount}`}
                />
              </Box>
              <CardContent>
                <Typography variant="overline" color="text.secondary">
                  {event.brand}
                </Typography>
                <Typography variant="h6" gutterBottom>
                  {event.title}
                </Typography>
                
                {!preview && (
                  <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
                    {event.description}
                  </Typography>
                )}

                <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                  <AccessTimeIcon sx={{ fontSize: 16, mr: 1, color: 'text.secondary' }} />
                  <Typography variant="caption" color="text.secondary">
                    {event.period}
                  </Typography>
                </Box>

                <Button variant="outlined" fullWidth>
                  자세히 보기
                </Button>
              </CardContent>
            </EventCard>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default BrandDiscounts;
